DROP TABLE IF EXISTS `t_bd_admin`;
CREATE TABLE `t_bd_admin`  (
  `admin_id` int NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `enterprise_id` int NULL DEFAULT NULL COMMENT '企业ID',
  `admin_external_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户对外id（生成后不能修改）',
  `relation_id` int NOT NULL DEFAULT 4 COMMENT '员工或者客户或者供应商关联关系id',
  `admin_origin_id` int NULL DEFAULT -1 COMMENT '用户来源',
  `admin_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名字',
  `admin_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户编码',
  `admin_password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户密码',
  `telephone` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '电话号码',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '邮箱',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `create_user_id` int NULL DEFAULT NULL COMMENT '创建人id',
  `modify_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `modify_user_id` int NULL DEFAULT NULL COMMENT '修改人id',
  `figureurl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像',
  `figureurl_1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像1',
  `data_status` int NULL DEFAULT 1 COMMENT '数据状态(1:审核中（默认）2：审核未通过 3：已审核）',
  `failure_describe` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核失败原因',
  `delete_status` int NULL DEFAULT 1 COMMENT '删除状态0：已删除1：未删除(默认未删除）',
  `enabled` int NULL DEFAULT 1 COMMENT '是否可用 默认值：0：不可用 1：可用  默认可用',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `user_define` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户自定义',
  `warrant` int NULL DEFAULT 0 COMMENT '是否授权协议',
  PRIMARY KEY (`admin_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 157 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户信息表包含用户基本信息' ROW_FORMAT = Dynamic;

