DROP TABLE IF EXISTS `t_bd_module`;
CREATE TABLE `t_bd_module`  (
  `module_id` int NOT NULL AUTO_INCREMENT,
  `module_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模块名字',
  `module_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '模块URL',
  `keyWord` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '权限字',
  `flag` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '前端需要的属性 fold无子类  layout有孩子',
  `module_type` int NOT NULL DEFAULT 1 COMMENT '模块类型',
  `parent_id` int NOT NULL DEFAULT -1 COMMENT '模块父ID（-1表示是父模块）',
  `order_no` int NULL DEFAULT NULL COMMENT '模块序号',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` int NULL DEFAULT NULL COMMENT '创建人',
  `modify_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `modify_user_id` int NULL DEFAULT NULL COMMENT '修改人',
  `image_path` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图像路径',
  `user_define` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户自定义',
  `delete_status` int NULL DEFAULT 1 COMMENT '删除状态0：已删除1：未删除(默认未删除）',
  `support_report` int NULL DEFAULT 0 COMMENT '是否支持报表，默认不支持0 支持为1',
  `enabled` int NULL DEFAULT 1 COMMENT '是否可用 默认值：0：不可用 1：可用  默认可用',
  PRIMARY KEY (`module_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 102 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '模块表包含模块基本信息' ROW_FORMAT = Dynamic;

